window.bookSummaryJSON = "<p>The Navy SEALs trained him.</p> <p>A secret unit of the NCIS recruited him.</p> <p>Enemies fear him.</p> <p>For elite undercover operative Jack Widow, the news that someone shot his mother, a small-town sheriff, will unleash him in number one best-selling author Scott Blade's explosive series starter.</p> <p>Pulled off an undercover assignment, Widow returns home to a small town in Mississippi - a place he tried to forget.</p> <p>Taken to be a worthless drifter by the locals, Widow uses his skills to uncover the truth about his mother's last investigation. What was she looking for?</p> <p>What he discovers is an unsolved mystery of missing girls and townspeople harboring a deadly secret - a secret they'll die to protect.</p> <p>Good thing that Jack Widow will kill to find out what.</p> <p>Fans of Lee Child's Jack Reacher, Tom Clancy's Jack Ryan, Vince Flynn's Mitch Rapp, and Mark Greaney's The Gray Man series will love the Jack Widow action-thriller-mystery series.</p> <p>If gripping thrillers loaded with mystery, suspense, action, twists, and turns is your thing, then Jack Widow is for you!</p> <p>Listen to international best seller Scott Blade's first explosive book in the Jack Widow series today.</p>"; 
